      listed as Integra Telecom as the company changed ownership.  5.  This was due
      to a bookkeeping error which has since been corrected and this amended report
      correctly displays the debts owed by the committee.  In addition, controls have
      been put in place by the committee to ensure that errors like this are corrected
      prior to filing the report.  6.  This issue has been corrected.  7.  This item
      has been corrected.
